  false,\n\t\"url\": null,\n\t\"notes\": \"nThis data set is a digital soil survey
  and generally is the mostndetailed level of soil geographic data developed by the
  NationalnCooperative Soil Survey. The information was prepared by digitizingnmaps,
  by compiling information onto a planimetric correct basenand digitizing, or by revising
  digitized maps using remotelynsensed and other information.nnThis data set consists
  of georeferenced digital map data andncomputerized attribute data. The partial data
  set includes andetailed, field verified inventory of soils and miscellaneousnareas
  that normally occur in a repeatable pattern on thenlandscape and that can be cartographically
  shown at thenscale mapped. A special soil features layer (point and linenfeatures)
  is optional. This layer displays the location of featuresntoo small to delineate
  at the mapping scale, but they are largenenough and contrasting enough to significantly
  influence use andnmanagement. The soil map units are linked to attributes in thenNational
  Soil Information System relational database, which givesnthe proportionate extent
  of the component soils and their properties.n\",\n\t\"license_title\": null,\n\t\"extras\":
